import {Link} from 'react-router-dom'

import style from './Header.module.scss'

function Header() {
    return ( 
        <div className={style.wrapper}>
            <Link to={'/'}>Logo</Link>
            <Link to={'/aboutUs'}>About Us</Link>
            <Link>Contact</Link>
        </div>
     );
}

export default Header;
